import React from 'react';
import Header from './Header'; // Import the Header component
import './App.css'; // Import the App.css file for styling

const App = () => {
  return (
    <div className="App">
      {/* Header Section */}
      <Header />

      {/* Main Content Section */}
      <main>
        <section id="services">
          <h2>Our Services</h2>
          {/* You can add content here for services */}
        </section>

        <section id="about">
          <h2>About Us</h2>
          {/* You can add content here about your website */}
        </section>
      </main>
    </div>
  );
};

export default App;
